                if v in positions:
                    positions[v].append((r, c))

        def fill_score(col):
            pos = positions[col]
            bottom = 1 if any(r == h - 1 for r, _ in pos) else 0
            corner = 1 if any((r, c) in corners for r, c in pos) else 0
            border = 1 if any(r == 0 or r == h - 1 or c == 0 or c == w - 1 for r, c in pos) else 0
